import I18n from '@iobroker/adapter-react/i18n';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';
import AddCircleOutlineIcon from '@material-ui/icons/AddCircleOutline';
import DeleteForeverIcon from '@material-ui/icons/DeleteForever';
import { boundMethod } from 'autobind-decorator';
import React from 'react';
import { CommandConfig, EzoDOConfig } from '../../../src/devices/ezodo';
import Dropdown, { DropdownOption } from '../components/dropdown';
import { DeviceBase, DeviceProps } from './device-base';
import { DeviceInfo } from './device-factory';

class EzoDO extends DeviceBase<EzoDOConfig> {
    private readonly commandOptions: DropdownOption[] = [
        { value: 'R', title: 'Read D.O. mg/L' },
        { value: 'i', title: 'Device Information' },
    ];

    constructor(props: DeviceProps<EzoDOConfig>) {
        super(props);

        let config: EzoDOConfig;
        if (!props.config) {
            config = {
                commands: [],
            };

            props.onChange(config);
        } else {
            config = { ...props.config };
        }
        console.log('new EzoDOConfig()', props, config);
        this.state = { config: config };
    }

    @boundMethod
    protected addCommand(): void {
        const newCommand: CommandConfig = {
            command: '',
            name: '',
            pollingInterval: 1000,
            description: '',
        };
        this.doHandleChange('commands', [...this.state.config.commands, newCommand]);
    }

    @boundMethod
    protected deleteCommand(index: number): void {
        const newCommand = [...this.state.config.commands];
        newCommand.splice(index, 1);
        this.doHandleChange('commands', newCommand);
    }

    @boundMethod
    protected onCommandChange(event: React.FormEvent<HTMLElement>, checked?: boolean): boolean {
        const target = event.target as HTMLInputElement | HTMLSelectElement;
        const value = this.parseChangedSetting(target, checked);
        const parts = target.name.split('-');
        const index = parseInt(parts[0]);
        const key = parts[1] as keyof CommandConfig;

        return this.doHandleCommandChange(index, key, value);
    }

    @boundMethod
    protected onCommandSelectChange(index: number, value: string): void {
        this.doHandleCommandChange(index, 'command', value);
    }

    private doHandleCommandChange<K extends keyof CommandConfig>(index: number, key: K, value: any): boolean {
        const command: CommandConfig = { ...this.state.config.commands[index] };
        command[key] = value;
        const newCommand = [...this.state.config.commands];
        newCommand[index] = command;

        return this.doHandleChange('commands', newCommand);
    }

    protected renderCommands(): React.ReactNode {
        return this.state.config.commands.map((command, i) => (
            <Grid key={`command-${i}`} container spacing={3}>
                <Grid item xs={2}>
                    <Dropdown
                        attr={`${i}-command`}
                        options={this.commandOptions}
                        value={command.command.toString()}
                        onChange={(value: string) => this.onCommandSelectChange(i, value)}
                        style={{ paddingTop: '6px' }}
                    />
                </Grid>
                <Grid item xs={3}>
                    <TextField
                        name={`${i}-name`}
                        value={command.name || ''}
                        type="text"
                        fullWidth
                        onChange={this.onCommandChange}
                    />
                </Grid>
                <Grid item xs={2}>
                    <TextField
                        name={`${i}-pollingInterval`}
                        value={command.pollingInterval}
                        type="number"
                        fullWidth
                        onChange={this.onCommandChange}
                    />
                </Grid>
                <Grid item xs={1}>
                    <Button variant="contained" onClick={() => this.deleteCommand(i)} style={{ marginTop: '0px' }}>
                        <DeleteForeverIcon />
                    </Button>
                </Grid>
            </Grid>
        ));
    }

    public render(): React.ReactNode {
        return (
            <>
                <Grid container spacing={3}>
                    <Grid item xs={7} sm={5} md={3}>
                        <TextField
                            name="name"
                            label={I18n.t('Name')}
                            value={this.state.config.name || ''}
                            type="text"
                            fullWidth
                            onChange={this.handleChange}
                        />
                    </Grid>
                </Grid>
                <Grid container spacing={3}>
                    <Grid item xs={2}>
                        <strong>{I18n.t('Command')}</strong>
                    </Grid>
                    <Grid item xs={3}>
                        <strong>{I18n.t('Description')}</strong>
                    </Grid>
                    <Grid item xs={2}>
                        <strong>{I18n.t('Polling Interval')}</strong>
                    </Grid>
                </Grid>
                {this.renderCommands()}
                <Grid container spacing={3}>
                    <Grid item xs={12}>
                        <Button variant="contained" onClick={this.addCommand}>
                            <AddCircleOutlineIcon />
                        </Button>
                    </Grid>
                </Grid>
            </>
        );
    }
}

export const Infos: DeviceInfo[] = [
    {
        name: 'Atlas Scientific D.O',
        addresses: DeviceBase.getAllAddresses(0x61, 30), // 97 - 127
        type: 'EzoDO',
        react: EzoDO,
    },
];
